// SPDX-License-Identifier: MIT
import './StringUtil.sol';
pragma solidity >=0.8.16 ;
    

contract HelloWorld{    
        function  myFirstHelloWorld() public pure virtual returns(string memory){
            return "Hello World! My name is Zhou Yanan.";

    }

}

contract HelloMyWorld is HelloWorld{
    using StringUtil for *;
    
    function  myFirstHelloWorld() public pure override returns(string memory){
        string memory str0 = "Hello World! My name is Zhang San.";
        string memory tempStr = super.myFirstHelloWorld();
        
        if(StringUtil.compare(str0,tempStr)==StringUtil.CompareResult.Equal){
            return "It's not me!";

        }
        else{
            return string.concat(str0,"My class number is 202.");
        }
           
    }
}

